import React from 'react'
import { BrowserRouter as Router, Switch, Route, Redirect } from 'react-router-dom';
import { Header } from './components/ui/Header'
import { DirectorView } from './components/director/DirectorView';
import { GeneroView } from './components/genero/GeneroView';
import { MediaView } from './components/media/MediaView';
import { ProdcutoraView } from './components/productora/ProdcutoraView';
import { TipoView } from './components/tipo/TipoView';


const App = () => {
  return <Router>
    <Header/>
    <Switch>
      <Route exact path='/' component = {MediaView}></Route>
      <Route exact path='/director' component = {MediaView}></Route>
      <Route exact path='/genero' component = {MediaView}></Route>
      <Route exact path='/productora' component = {MediaView}></Route>
      <Route exact path='/tipo' component = {MediaView}></Route>
    </Switch>
  </Router> 
  
}

export {
    App
}
